import ReactDOM from 'react-dom'
import React from 'react'

function tick(props) {
    const element = (
      <div>
        <h1>Hello, {props.name}!</h1>
        <h2>It is {new Date().toLocaleTimeString()}.</h2>
      </div>
    );
    ReactDOM.render(element, document.getElementById('root'));
}
  
  setInterval(tick, 1000);
